css:
.select-list.popover-list.popover-list-subtle {
  background-color: transparent;
  border: none;
  border-radius: 0;
  box-shadow: none;
  padding: 0;
  /*
   * Beat specificity of `.select-list.popover-list atom-text-editor` to ensure subtle dropdowns
   * have no bottom margin.
   */
}
.select-list.popover-list.popover-list-subtle atom-text-editor[mini] {
  margin-bottom: 0;
}
.nuclide-combobox-options {
  position: absolute;
  z-index: 999;
}
.nuclide-combobox-options .nuclide-combobox-list-group.list-group {
  background: #132132;
  border: 1px solid #0b141e;
  border-top: none;
  margin-top: 0;
}
.nuclide-combobox-options .nuclide-combobox-list-group.list-group li {
  padding-left: 0.5em;
  padding-right: 0.5em;
}
.nuclide-combobox-options .nuclide-combobox-list-group.list-group strong {
  font-weight: bold;
}
